const LIBS: &[(Endian, &'static str)] = &[
    (Endian::Little, "aarch64"),
    (Endian::Little, "aarch64_applesilicon"),
    (Endian::Big, "aarch64be"),
];

#[test]
fn aarch64() {
    for (_endian, lib) in LIBS.iter() {
        println!("{}", lib);
        let ld_lib = unsafe {
            libloading::Library::new(format!("../target/debug/lib{}.so", &lib))
                .unwrap()
        };
        let parse_fun: libloading::Symbol<
            fn(&'_ [u8], u64) -> Option<(u64, String)>,
        > = unsafe { ld_lib.get(b"parse_default\0").unwrap() };

        let instructions = BASIC_INSTRUCTIONS.iter();
        #[cfg(feature = "all-tests")]
        let instructions = instructions.chain(ALL_INSTRUCTIONS.iter());
        for instruction in instructions {
            let token = instruction.to_tokens();
            let (_next_addr, parsed_output) =
                parse_fun(&token, instruction.0).expect(&instruction.2);
            assert_eq!(&remove_spaces(&parsed_output), &instruction.2);
        }
    }
}
